import { FcFolder } from "react-icons/fc";

const FileComponent = () => {
  return (
    <div>
      <div>
        <FcFolder />
        <span>File 1</span>
      </div>
      <div>
        <FcFolder />
        <span>File 2</span>
      </div>
      <div>
        <FcFolder />
        <span>File 3</span>
      </div>
    </div>
  );
};

export default FileComponent;
